import React from 'react'

const ProjectSummary = ({project}) => {
  return (
    <div class="card allcards">
			<div class="card-image waves-effect waves-block waves-light">
				<img class="activator thumbs" src="https://images.squarespace-cdn.com/content/v1/556eaad9e4b099eddb4c9845/1497922562864-X0FQUXW912R6057SEBD8/ke17ZwdGBToddI8pDm48kMXRibDYMhUiookWqwUxEZ97gQa3H78H3Y0txjaiv_0fDoOvxcdMmMKkDsyUqMSsMWxHk725yiiHCCLfrh8O1z4YTzHvnKhyp6Da-NYroOW3ZGjoBKy3azqku80C789l0luUmcNM2NMBIHLdYyXL-Jww_XBra4mrrAHD6FMA3bNKOBm5vyMDUBjVQdcIrt03OQ/image-asset.jpeg?format=750w"></img>
			</div>
			<div class="card-content">
				<span class="card-title activator grey-text text-darken-4">{project.name}<i class="material-icons right">more_vert</i></span>
			</div>
			<div class="card-reveal">
				<span class="card-title grey-text text-darken-4">Card Title<i class="material-icons right">close</i></span>
				<p>Here is some more information about this product that is only revealed once clicked on.</p>
			</div>
  		</div>
  )
}

export default ProjectSummary


